import React from 'react'
//functional Component
function Header(){
    return(
      <div>
        <h1>Header</h1>
        <ul>
          <li>Home</li>
          <li>About</li>
          <li>Login</li>
        </ul>
      </div>
    )
  }
  //class Component
  class Footer extends React.Component{
    render(){
      return(
        <div>
          <ol>
            <li>Link 1</li>
            <li>Link 2</li>
            <li>Link 3</li>
          </ol>
        </div>
      )
    }
  }
  export default Header;
